import React from "react";
import { useMocks } from "../context/mock-context";
const Menu = props => {
  const { menu } = useMocks();
  return (
    <ul>
      {menu.map(item => (
        <li>{item.item}</li>
      ))}
    </ul>
  );
};
export default Menu;
